import React from 'react';

function Header() {
  return (
    <header className="App-header">
      <div header>

      </div>
      <Title />
      <Navigation />
    </header>
  );
}

function Title() {
  return <h1>React Google Maps with Markers jhdhdh lol </h1>;
}

function Navigation() {
  return (
    <nav>
      <ul>
        <li><a href="#home">Home</a></li>
        <li><a href="#about">About</a></li>
        <li><a href="#contact">Contact</a></li>
      </ul>
    </nav>
  );
}

export default Header;
